import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div>
      <Container>
        <Row>
          <Col xs={12}> sm={6}
          
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
